       className="card_info"></img>
       <span className='card_category'>{props.title}</span>
       <h3 className='card_tittle'>{props.name}
         </h3>
         <a href={props.links}
         target="_blank">

           <button>watch Now</button>
           </a>

           </div>

        </div>

  </>

  )
};


export default Card;
